import Banner from '../components/Banner'
import About from '../components/About'

function Aboutuspage() 
{
  return (
    <div>
      
       <Banner apiEndpoint="http://localhost:5000/api/banner/about" height="300px" />

        <About />
      

    </div>
  )
}

export default Aboutuspage;
